class Solution {
    public int minimumOperationsToMakeEqual(int x, int y) {
        if (x == y) return 0;
        int operations = 0;
        while (x != y) {
            if (x < y) {
                operations += y - x;
                break;
            } else {
                int diff = x - y;
                if (x % 11 == 0 && (diff > 10 || diff % 2 != 0)) {
                    x /= 11;
                } else if (x % 5 == 0 && (diff > 4 || diff % 2 != 0)) {
                    x /= 5;
                } else if (diff % 2 == 0 || diff < 5) {
                    x--;
                } else {
                    x++;
                }
                operations++;
            }
        }
        return operations;
    }
}
